const blocks = [
  {
    order: 1,
    seconds: 10,
    title: 'Push Ups',
    color: 'green'
  },
  {
    order: 2,
    seconds: 20,
    title: 'Rest',
    color: 'blue'
  },
  {
    order: 3,
    seconds: 40,
    title: 'Pull Ups',
    color: 'red'
  }
];


export default blocks;
